import React, { useState } from "react";
import Navbar from "./Navbar.js";
import Axios from "axios";

function App() {
  const [users, setUsers] = useState(null);

  // fetch('https://reqres.in/api/users?page=1')
  //   .then((response) => response.json())
  //   .then((data) => {
  //     console.log(data)
  //   });
  const fetchUserData = () => {
    fetch("https://jsonplaceholder.typicode.com/users")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setUsers(data)
      })
  }

  Axios.get('https://reqres.in/api/users?page=1')
    .then((response) => {
      setUsers(response.data.data[1].email)
    });

  return (
    <div className="App">
      <Navbar />
      <div className="users">
        <div>
          <img src="https://reqres.in/img/faces/2-image.jpg" />
        </div>
        <div className="details">
          <p className="id"><span>ID: </span>2</p>
          <div className="name">
            <p className="f_name"><span>First Name: </span>Janet</p>
            <p className="l_name"><span>Last Name: </span>Weaver</p>
          </div>
          <p className="email">
            <span>E-mail: </span>
            {users}
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
